import {
  Box,
  Divider,
  Drawer,
  FormControl,
  InputLabel,
  List,
  ListItem,
  MenuItem,
  Select,
  Toolbar,
} from '@mui/material';
import { useState } from 'react';
import { EXPLORE_SIDE_PANEL_WIDTH } from '../consts';

type Filters = { type: string | undefined };

export const FilterSidePanel = () => {
  const [filters, setFilters] = useState<Filters>({ type: undefined });
  return (
    <Box
      component='nav'
      sx={{ width: { sm: EXPLORE_SIDE_PANEL_WIDTH }, flexShrink: { sm: 0 } }}
      aria-label='mailbox folders'
    >
      <Drawer
        variant='permanent'
        sx={{
          display: { xs: 'none', sm: 'block' },
          '& .MuiDrawer-paper': { boxSizing: 'border-box', width: EXPLORE_SIDE_PANEL_WIDTH },
        }}
        open
      >
        <div>
          <Toolbar />

          <Divider />

          <List>
            <ListItem>
              <FormControl fullWidth size='small'>
                <InputLabel id='type-label'>Meal Type</InputLabel>
                <Select
                  labelId='type-label'
                  id='type'
                  value={filters.type}
                  label='Type'
                  onChange={(value) => {
                    setFilters((filters) => ({ ...filters, type: value }));
                    console.log(value);
                  }}
                >
                  <MenuItem value={'main course'}>Main Course</MenuItem>
                  <MenuItem value={'side dish'}>Side Dish</MenuItem>
                  <MenuItem value={'dessert'}>Dessert</MenuItem>
                  <MenuItem value={'appetizer'}>Appetizer</MenuItem>
                  <MenuItem value={'salad'}>Salad</MenuItem>
                  <MenuItem value={'bread'}>Bread</MenuItem>
                  <MenuItem value={'breakfast'}>Breakfast</MenuItem>
                  <MenuItem value={'soup'}>Soup</MenuItem>
                  <MenuItem value={'beverage'}>Beverage</MenuItem>
                  <MenuItem value={'sauce'}>Sauce</MenuItem>
                  <MenuItem value={'marinade'}>Marinade</MenuItem>
                  <MenuItem value={'fingerfood'}>Fingerfood</MenuItem>
                  <MenuItem value={'snack'}>Snack</MenuItem>
                  <MenuItem value={'drink'}>Drink</MenuItem>
                </Select>
              </FormControl>
            </ListItem>
            {Array.from(Array(8)).map((_, index) => (
              <ListItem key={index}>
                <FormControl fullWidth size='small'>
                  <InputLabel id='demo-select-small-label'>Cuisine</InputLabel>
                  <Select
                    labelId='demo-select-small-label'
                    id='demo-select-small'
                    value={5}
                    label='Cuisine'
                    onChange={(next) => {
                      console.log(next);
                    }}
                  >
                    <MenuItem value={10}>Ten</MenuItem>
                    <MenuItem value={20}>Twenty</MenuItem>
                    <MenuItem value={30}>Thirty</MenuItem>
                  </Select>
                </FormControl>
              </ListItem>
            ))}
          </List>

          <Divider />
        </div>
      </Drawer>
    </Box>
  );
};
